import React from 'react';
import { Menu } from '../../components/Menu';

export const Cadastrar = () => {

    return(
        <>

        <Menu />
        <h1>Cadastrar</h1>

        <form>
            <label>Nome: </label>
            <input type="text" name="nome" placeholder="Nome do produto" /> <br/><br/>
            
            <label>Valor: </label>
            <input type="text" valor="nome" placeholder="Valor do produto" /> <br/><br/>

            <label>Preço: </label>
            <input type="text" preco="nome" placeholder="Preço do produto" /> <br/><br/>

            <label>Quantidade: </label>
            <input type="text" name="quantidade" placeholder="Quantidade do produto" /> <br/><br/>

        </form>

        </>
    );
}
